import { useGet } from 'powerful-hooks';
import { Button, message } from 'antd';

function testPage() {
  const {
    data: resultData,
    loading: dataLoading,
    run: handleGetData,
    abort: handleAbort
  } = useGet({
    url: '/api/test/get',
    data: {
      testData: 'testData',
    },
    handler: (responese) => {
      const { code, data, msg } = responese;
      if (code == 0) {
        return data;
      } else {
        message.error(msg);
      }
    },
    manual: true,
  });

  const handleReGet = () => {
    const otherData = {
      test1: 'testData',
    };
    handleGetData(otherData);
  };

  return (
    <div>
      {dataLoading ? '\u52A0\u8F7D\u4E2D' : ''}
      {resultData ? JSON.stringify(resultData) : ''}
      <Button onClick={handleReGet}>\u53D1\u8D77\u8BF7\u6C42</Button>
      <Button onClick={handleAbort}>\u7EC8\u6B62\u8BF7\u6C42</Button>
    </div>
  );
}

